function GetCronExprFromDate(n){return n==null?"":n.getMinutes()+" "+n.getHours()+" "+n.getDate()+" "+(n.getMonth()+1)+" ? "+n.getFullYear()}function GetDateFromCron(n){var t=n.split(" "),i=new Date(t[5],t[3]-1,t[2],t[1],t[0],0,0);return isNaN(i.getTime())&&(i=new Date,i.setDate((new Date).getDate()+1)),i}